import logo from './logo.svg';
import './App.css';
import './style.css'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect
} from "react-router-dom";
import Home from './pages/Home'

function App() {
  return (
    <Router>
      <Switch>
          <Route path="/">
              <Home/>
          </Route>
      </Switch>
    </Router>
  );
}

export default App;
